INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('20080655', 'Barres céréales chocolat', 'Enrobage au chocolat au lait 26 % (sucre, pâte de cacao, beurre de cacao, lait entier en poudre, émulsifiant : lécithine de soja, arôme naturel de vanille), sirop de glucose-fructose, billes croustillantes au blé 13,7 % (farine de blé, farine de seigle, farine de malt d\'orge), flocons de céréales grillées 13,7 % (flocons d\'avoine 8,2 %, flocons d\'épeautre, flocons d\'orge), billes croustillantes au blé et aux riz 7,6 % (farine de blé, farine de riz, farine de malt d\'orge, sucre, farine de maïs, sel), cacahuètes hachées et grillées, matière grasse végétale, pétales de maïs (maïs, sucre, sel, extrait de malt d\'orge), lait concentré sucré, amandes hachées et grillées, stabilisant : glycérol, émulsifiant : esters citriques des mono - et diglycérides d\'acides gras, sel, arôme naturel.', 'https://static.openfoodfacts.org/images/products/20080655/front_fr.16.400.jpg', '17.3', '9.8', '63.2', '29.5', '4.9', '8.7', '0.3', '0.118110236220472', '', '0');

