VALUES ('20080662', 'Barres céréales Choco & Banane', '24% enrobage au chocolat au lait [sucre, pâte de cacao, beurre de cacao, LAIT en poudre entier, LAIT en poudre écrémé, beurre concentré (LAIT), émulsiﬁant : lécithines (tounesol) ; arôme naturel de vanille], sirop de glucose-fructose, 15,4% pétales de BLÉ, de riz et de maïs (7.4% farine de BLÉ, 39% farine de riz, 1.8% farine de malt d\'ORGE, sucre, 0,9% farine de maïs, sel), 14.1 % flocons de céréales complètes (ﬂocons d\'AVOINE, flocons de BLÉ, flocons d\'ORGE), 5,2 % pétales de BLÉ complet (farine de BLÉ complet), 5 % chips de banane (3.4 % banane, huile de coco, sucre), 4.8 % cornflakes (maïs, sel, extrait de malt d\'ORGE), huile de tournesol, humectant : glycérol ; sucre, NOISETTES hachées et grillées, miel, arôme naturel, émulsiﬁant: lécithines (tournesol) ; sirop de sucre caramélisé (sirop de glucose, sucre), sel', 'https://static.openfoodfacts.org/images/products/20080662/front_fr.14.400.jpg', '16.3', '7.6', '65.1', '32.8', '', '6.7', '0.31', '0.122047244094488', '', '0');

